import React, { Component } from 'react'
import AdminForm from './AdminForm'
import './Admin.css'

class Admin extends Component {
  render () {
    const form = Object(this.props.data.contact).map(
      <AdminForm data={this.props.data.contact} />
    )
    return (
      <div className='app'>
        <header>
          <h1>Administration</h1>
        </header>
        {form}
      </div>
    )
  }
}
export default Admin
